pragma solidity ^0.5.2;

import "./thing.sol";


contract IMedianizer {
    function poke(uint _marketId) external returns (bool);
    function usesYBT() public view returns (bool);
}

interface Rewards {
    function poke() external returns (bool);
}


contract PriceFeed is DSThing {
    event Post(
        uint market,
        uint val,
        uint expiry,
        address medianizer
    );

    mapping (uint => uint) public values;
    mapping (uint => uint) public expiry;

    function read(uint _marketId) external view returns (uint) {
        if (now < expiry[_marketId]) {
            return values[_marketId];
        } else {
            return 0;
        }
    }

    function poke(uint _marketId, uint val_, uint expiry_) external note auth {
        values[_marketId] = val_;
        expiry[_marketId] = expiry_;
    }

    function post(uint _marketId, uint val_, uint expiry_, address med_, address token_) external note auth {
        require(expiry_ > now, "Expiry timestamp has passed");
        values[_marketId] = val_;
        expiry[_marketId] = expiry_;
        IMedianizer(med_).poke(_marketId);
        if (IMedianizer(med_).usesYBT()) {
            Rewards(token_).poke();
        }
        emit Post(_marketId, val_, expiry_, address(med_));
    }
}
